import React, { useState , useEffect }from 'react';
// import logo from './logo.svg';
import Book from '../src/objects/Book'
import logic from './logic'
import './App.css';

function App() {
  const [books , setBooks] = useState(undefined)
  useEffect(()=>{
    async function retrieveBooks(){
      try {
        const retrievedBooks = await logic.retrieveBooksFromAPI()
        setBooks(retrievedBooks)
      } catch (error) {
        console.log(error)
      }
    }
    retrieveBooks()
  } , [setBooks])

  return (
    <div className="App">
      <header className="App-header">
        <h1>Google Books API</h1>
      </header>
      <section>
        <ul>
          {books && books.map( book => {
            let currentBook = new Book(book.title, book.subtitle, book.authors, book.publish_date, book.publisher, book.categories)
          })}
        </ul>
      </section>
    </div>
  );
}

export default App;
